import base64

def base64_to_mp3(base64_string, output_file):
    """
    将 Base64 编码的字符串保存为 MP3 文件。

    参数：
    base64_string (str): Base64 编码的 MP3 数据字符串。
    output_file (str): 保存 MP3 文件的路径和文件名。
    """
    try:
        # 解码 Base64 字符串
        mp3_data = base64.b64decode(base64_string)

        # 将解码后的数据写入 MP3 文件
        with open(output_file, 'wb') as f:
            f.write(mp3_data)

        print(f"MP3 文件已成功保存到：{output_file}")

    except base64.binascii.Error as e:
        print(f"Base64 解码错误：{e}")
    except Exception as e:
        print(f"发生错误：{e}")

# 示例用法
base64_string = ""
output_file = "output.mp3"  # 设置输出 MP3 文件的路径和文件名

base64_to_mp3(base64_string, output_file)